INSERT INTO `tr8n_glossary` VALUES (1,'Home','The homepage (often written as home page) is the URL or local file that automatically loads when a web browser starts or when the browser\'s \"home\" button is pressed. One can turn this feature off and on, as well as specify a URL for the page to be loaded.','2012-06-19 09:21:31','2012-06-19 09:21:31'),(2,'Relatives','A person who is connected with another or others by blood or marriage.','2012-06-19 09:21:31','2012-06-19 09:21:31'),(3,'Relative','A person who is connected with another or others by blood or marriage.','2012-06-19 09:21:31','2012-06-19 09:21:31'),(4,'Celebrities','A famous or well-known person. ','2012-06-19 09:21:31','2012-06-19 09:21:31'),(5,'Print','Printing is a process for reproducing text and image, typically with ink on paper using a printing press. It is often carried out as a large-scale industrial process, and is an essential part of publishing and transaction printing.','2012-06-19 09:21:31','2012-06-19 09:21:31'),(6,'Profile','A user profile (userprofile, or simply profile when used in-context) is a collection of personal data associated to a specific user. A profile refers therefore to the explicit digital representation of a person\'s identity. A user profile can also be considered as the computer representation of a user model.','2012-06-19 09:21:31','2012-06-19 09:21:31'),(7,'User','A person who uses computers for work or entertainment or communication or business.','2012-06-19 09:21:31','2012-06-19 09:21:31'),(8,'Tree','A family tree, or pedigree chart, is a chart representing family relationships in a conventional tree structure. The more detailed family trees used in medicine, genealogy, and social work are known as genograms.','2012-06-19 09:21:31','2012-06-19 09:21:31'),(9,'Poster','A poster is any piece of printed paper designed to be attached to a wall or vertical surface. Typically posters include both textual and graphic elements, although a poster may be either wholly graphical or wholly text.','2012-06-19 09:21:31','2012-06-19 09:21:31'),(10,'Inbox','An electronic folder for incoming e-mails or text messages.','2012-06-19 09:21:31','2012-06-19 09:21:31'),(11,'Photo','A picture produced by photography.','2012-06-19 09:21:31','2012-06-19 09:21:31'),(12,'Privacy','The state of being free from unsanctioned intrusion: a person\'s right to privacy.','2012-06-19 09:21:31','2012-06-19 09:21:31');
